import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { ApproveMassUploadComponent } from '../approve-mass-upload/approve-mass-upload.component';
import { MassUploadComponent } from '../mass-upload.component';

const massUploadRoutes: Routes = [
  {
    path: '',
    component: MassUploadComponent,
    data: {
      defaultSort: 'id,asc',
      pageTitle: 'nspay2App.payroll.massUpload.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'approve',
    component: ApproveMassUploadComponent,
    data: {
      defaultSort: 'id.asc',
      pageTitle: 'nspay2App.payroll.massUpload.approve.title'
    },
    canActivate: [UserRouteAccessService]
  },
];


@NgModule({
  imports: [RouterModule.forChild(massUploadRoutes)],
  exports: [RouterModule]
})

export class MassUploadRoutingModule {
}
